sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var jsonObj = JSON.parse(inputs.rest_body);
  var temp = jsonObj.u_request_type;
  outputs.var1 = temp;

  var requestBody = {}
  var item = {};
  item.sub_item1 = "i am one";
  item.sub_item2 = "i am two";
  gs.debug("test","test log");
  requestBody.items = item;
  requestBody.test = "test1";
  //Encode as JSON
  requestBodyRet = new global.JSON().encode(requestBody);
  gs.debug('Answer: ' + requestBodyRet);
  outputs.gbbinput = requestBodyRet;

})(inputs, outputs);

